?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Эта знаменитая во всем мире часовая компания была основана в далеком 1904 году. Изначально, дела у компании шли не очень, однако спустя всего 5 лет, Oris радовала всю Европу несколькими десятками новых моделей своих наручных часов. Компания сразу сделала ставку на производство высококачественных и надежных часов, которые отличались своей многофункциональностью. Стоит отметить, что, несмотря на все достоинства часов Oris, компания предлагает свою продукцию по весьма адекватным ценам (особенно, если сравнивать с другими знаменитыми брендами). Самая знаменитая модель это, несомненно, часы, которые посвящены известнейшему Фрэнку Синатре. Даже в современное время эти часы остаются популярным, особенно среди коллекционеров. А компания Oris все также продолжает выпуск часов, выполненных в ретро-стиле. Однако, не только ретро-моделями знаменита эта компания. В настоящее время она производит модернизированные модели с многочисленными функциями. И количество функций в одном экземпляре часов, иногда просто поражает. Ведь ни у одной компании, производящей часовые механизмы, не встречаются модели, в которых существует столько функций. Одним словом, ассортимент часов у компании Oris настолько разнообразен, что любой ценитель часового искусства, даже самый придирчивый, сможет выбрать часы по своему&nbsp; вкусу.</span></span></p>
 
